import React from 'react';
import Td from './Td';
const Tr = ({data, theme}) => {
	return (
		<tr>
			<Td theme={theme}>{data.id}</Td>
			<Td theme={theme}>{data.name}</Td>
		</tr>
	);
};

export default Tr;
